    value: 'June 14, 2013    Federal Election Commission  Washington D.C. 20463  Attention:
      Mr. Paul Stoetzer    Dear Mr. Stoetzer:    We are in receipt of your letter
      dated March 1, 2013 regarding our October Monthly Report (09/01/2012 - 09/30/2012)
      in which you questioned the following items:    1. Our report discloses contributions
      that were not disclosed on another committee report.    We have reviewed the
      copy of checks forthe contributions in question and contacted the donor directly.
      These checks appear to be non-federal contributions and will be transferred
      as soon as funds become available.    2. Contributions exceed contribution limits.    See
      item #1 above as they pertain to the same donation.    4. Our report discloses
      transfers from the NRCC and RNC. In addition, our report discloses expenses
      for door hangers, etc.    No funds received from the RNC or NRCC were used to
      pay for this activity.    5. Our report discloses disbursements to Wells Fargo
      for Cash for volunteer meals.    No cash disbursement to any person or vendor
      exceeded $100 for any single transaction.  Each volunteer was given $30 to cover
      meals, snacks, drinks, etc., purchased from a vendor of there choice. We believe
      we have reported this transaction correctly.    6. Schedule H4 discloses lump
      sum payments to office team and Labor ready for payroll purposes but no itemization
      for each employee is listed.    These are contracted labor companies that provided
      people to canvass neigborhoods/perform surveys regarding our caucus/convention
      system of election.  The company was engaged by the UTGOP to perform that task.
      Therefore, We believe the transaction is reported correctly.    8. Fundraising
      expense described on H4 pertain to a retainer fee for a fundraising group in
      Utah. They were hired to increase our donor file and find other possible avenues
      of donors to the UTGOP.  The fees were not associated with a single fundraising
      event. Therefore, We believe it reported correctly.    Sincerely,       Mike
      McCauley, CPA  UTGOP treasurer     '
